import { createSlice } from "@reduxjs/toolkit";

export const userSlice = createSlice({
  name:"user",
  initialValue:
  {value: {customerName:"",dob:"",city:"",state:"",country:"",nickName:"",email:"",phone:""}},
  reducers:{
    login: (state,action) => {
      state.value=action.payload;

    }
  }
});

export default userSlice.reducer;
